class Solution(object):
    def maxScore(self, nums, x):
        """
        :type nums: List[int]
        :type x: int
        :rtype: int
        """
        def dfs(i, j, memo):
            if (i, j) in memo:
                return memo[(i, j)]
            if i >= j:
                return 0
            score = 0
            if nums[i] % 2 == nums[j] % 2:
                score = max(nums[i] + dfs(i + 1, j, memo), nums[j] + dfs(i, j - 1, memo))
            else:
                score = max(nums[i] - x + dfs(i + 1, j, memo), nums[j] - x + dfs(i, j - 1, memo))
            memo[(i, j)] = score
            return score

        memo = {}
        return nums[0] + dfs(1, len(nums) - 1, memo)
